'use strict';
let MessageType = require('./MessageType.js');
let RawOffersList = require('./RawOffersList.js');
class GetRawOffersMessage {
    rawOffersList;
    constructor() {
        this.rawOffersList = new RawOffersList();
    }
    getOffers() {
        return this.rawOffersList.toArray();
    }
    getType() {
        return MessageType.GetRawOffers;
    }
}
module.exports = GetRawOffersMessage
